import { contextData } from './Context'

export const Label3img = () => {
    const [data]=useContext(contextData);
    const dt=data.length-1;
    // if([data.length-1]==data.id)
console.log(data.length,data[data.length-1].image,data[34].id);
    return (
        <div>
            <h1>{data[dt].title}</h1>
            <p>{data}</p>
            <img src={data[dt].image}/>
        </div>
    )
}
